import React from "react";

function ImageAndText({
  className,
  wrapper,
  headingClass,
  heading,
  section,
  sectionClass,
  source,
  imgClass,
  props
}) {
  return (
    <div className={props.className}>
      <div className={props.wrapper}>
        <h1 className={propsheadingClass}>{heading}</h1>
        <section className= {   sectionClass}>{section}</section>
      </div>
      {source !== null ? <img src={source} className={imgClass} /> : ""}
    </div>
  );
}

export default ImageAndText;
